import React from "react";

import { Drawer, DrawerItem } from "../../../components/Drawer";

const Navigation = () => {
  return (
    <Drawer onChange={console.log}>
      <DrawerItem id name="apple"  icon="apple"   />
      <DrawerItem id name="apple1" icon="apple"  />
      <DrawerItem id name="apple2" icon="apple"  />
      <DrawerItem id name="apple3" icon="apple"  />
      <DrawerItem id name="apple4" icon="apple"  />
      <DrawerItem id name="apple5" icon="apple"  />
      <DrawerItem id name="apple6" icon="apple"  />
      <DrawerItem id name="apple7" icon="apple"  />
    </Drawer>
  );
};

export default Navigation;
